Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"subContentId\":\"3c514d96-0031-49f2-ba61-f28b7929caeb\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}}},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>The document above is a picture of 2 palm trees and a drawing of their respective flowers.</p>\\n\\n<p>The blue flower was found on the left tree and the pink flower was found on the right tree.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"d0375272-5ca1-4849-a5d3-600fb6c082ab\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<p>1-Compare both flowers. What difference do you see between them?</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"a203b399-32c4-4e0e-9321-dfc5548401b2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<p>2-What can you say about each flower? Which flower is a male and which is a female? What can you conclude about the palm tree?</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"66ce4076-f10e-4a20-891d-ef8202bfb867\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<p>3- How can the female plant produce fruits? What type of pollination is necessary? Describe.</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"18325cb8-a5f6-48a2-85e5-dba4934f4e99\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"dc280421-3651-4ec2-bea3-b4294f07705c\",\"metadata\":{\"title\":\"Palm trees\",\"license\":\"U\",\"contentType\":\"Standard page\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Palm trees\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1- The blue flower contains only stamens and the pink flower contains only a pistil.</p>\\n\\n<p>2- The blue flower is a male flower and the pink flower is a female flower. I can conclude that the palm tree is a <em>dioecious</em> plant since the male and female reproductive systems are on separate plants .</p>\\n\\n<p>3- Through cross pollination. Which means that pollen grains may be transported from the male plant to the female plant by wind, insects, or birds...Following pollination, fertilization of the ovule occurs and fruits develop.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"c5d8fb47-9f84-49b2-b547-daafc04ecc55\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"91b09882-664c-4130-a5a9-e4c58620aac9\",\"metadata\":{\"title\":\"Click here for the answer.\",\"license\":\"U\",\"contentType\":\"Standard page\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click here for the answer.\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"fcd3a908-099f-422d-887e-77203a232250\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation tool\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<hr />\\n<p></p>\\n\"},\"library\":\"H5P.Advanced T/h//ABjpxo/tv74do/a/Y/e/5F99f+LfYf8AA6u0/wB7f4z/AL9/z20/w3+Hf8oOq/Ov379Ko/3H/wCqnT48TS3+5H/GOjT/AAK8P/DhuI0f3S1/6ON1+T+7/wB99l5P7s0f/AH7j9j+M6L/AHvi/a06v7Vvcx+y+n+se96dH/JO/Dq/5SIuOr+fzp1EPvJq/q7smrxP9z/xU/3xJ6fy+Vfl1sq+8jeseOve/de697917r3v3Xuve/de697917r3v3Xuve/de697917r3v3Xuve/de697917r3v3Xuve/de697917r3v3Xuve/de697917r/2Q==\",\"mime\":\"image/jpeg\",\"copyright\":{\"license\":\"U\"},\"width\":800,\"height\":379},\"alt\":\"Bamboo\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"subContentId\":\"2e23c5c9-4261-4607-8723-930ad19355c9\",\"metadata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Bamboos are invasive plants which means that they spread quickly and it is difficult to get rid of them.</p>\\n\\n<p>If you pull off the bamboo plants, a few days later, you may find bamboo <strong>shoots</strong> appearing out of the ground.</p>\\n\\n<p>If you dig the ground around the shoots, you will find an <strong>underground stem</strong> connecting the young shoots.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"228a817a-553f-4eda-b576-19fbb8024607\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"taskDescription\":\"<p>1-Where do the new shoots come from?</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"9fbcc86b-b4e5-4621-9f77-61c0b9c41e29\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"taskDescription\":\"<p>2- Describe the mode of reproduction of these bamboos using the following words: underground stem - rhizome - vegetative propagation - buds - new shoots - mother plant - asexual reproduction.</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"7bfdd646-aefe-47ac-bf6f-b0c8c1036549\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"04960625-a442-4682-848c-d8aadca1c2cc\",\"metadata\":{\"title\":\"Bamboos\",\"license\":\"U\",\"contentType\":\"Standard page\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Bamboos\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1- New shoots come from buds present on the rhizomes.</p>\\n\\n<p>2- This is a case of an asexual reproduction or vegetative propagation of bamboos. The mother plant produces an underground stem called rhizome. Rhizomes bear buds from which new shoots develop and grow above the ground.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"a1a163ab-7234-4c5a-b2b0-6f7d21471246\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"d7c256b8-aef0-4c86-8bf7-0299ce80c600\",\"metadata\":{\"title\":\"Answer\",\"license\":\"U\",\"contentType\":\"Standard page\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"fccb7646-ca56-4af1-8374-ba47123ef1d1\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation tool\"}},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.13","contentUrl":".","metadata":{
